ecoration:underline;}',nrb='/ by zero',zsb='//EX',ysb='//OK',orb='0',Brb='0px',Oub='1',vtb='100%',Wvb='1000',dvb='150',Uub='1px',gvb='2d',cvb='300',Gxb='4DC5AC4F14637D171A6D27582451583C',crb=':',Rob=': ',Evb='<b>A bubble<\/b>',Fvb='<b>Another bubble<\/b>',Dvb='<b>New Mind Map<\/b>',ywb="<div class='GpzsesyE'> <p><a href='http://code.google.com/p/mind-notes/source/checkout' target='_blank'>View source<\/a><br> <a href='http://code.google.com/p/mind-notes/issues/list' target='_blank'>Report a bug<\/a><br> <a href='http://code.google.com/p/mind-notes/issues/list' target='_blank'>Propose a feature<\/a><\/p> <h2>Iteration 4<\/h2> <p> <strong>Local Storage<\/strong> <\/p> <ul> <li>You can now save your maps locally using HTML5 local storage.<\/li> <li>The \"Open\" link in the top right corner allows you to open maps from cloud, open local maps, and delete maps<\/li> <\/ul> <p> <strong>Rich text editing<\/strong> <\/p> <ul> <li>TinyMCE is now integrated into the app, providing first-class rich text editing.<\/li> <\/ul> <p> <strong>UI improvements<\/strong> <ul> <li>Creating nodes and selecting them is less laggy (still a little bit too much jumpy for my taste)<\/li> <li>You can now change the mind map title and it is constantly visible in the window.<\/li> <li>There are neat buttons with icons instead text buttons for node actions.<\/li> <li>You can now add siblings directly from sibling node selection<\/li> <li>There is a context menu that contains options for the node is meant to contain the most complete of node actions.<\/li> <li>When selecting a node, all child nodes of that node also get highlighted in a different color.<\/li> <\/ul> <\/p> <p> <strong>App cache<\/strong> <ul> <li>App cache manifest is now dynamically generated during compile time.<\/li> <\/ul> <\/p> <h2>Iteration 3<\/h2> <p> <strong>Cloud Storage<\/strong> <\/p> <ul> <li>The app now requires Google Accounts login; you should see your email in the top right corner.<\/li> <li>Try making your own mind map and click \"Save to cloud\"<\/li> <li>Make some changes or reload the page, then click \"Load from cloud\"<\/li> <\/ul> <p> <strong>App Cache<\/strong> <\/p> <ul> <li>The app can be loaded and used without an internet connection. Try disconnecting from the internet and then hitting refresh.<\/li> <li>Notice the cloud features are disabled now.<\/li> <\/ul> <h2>Iteration 2<\/h2> <p><strong>Better Layout, Undo Stack, Rich Text Formatting, Copy/Paste<\/strong><\/p> <ul> <li>The nodes are now positioned on an AbsolutePanel, and their positions are calculated by the script. Left-hand side and right-hand sides are now supported.<\/li> <li>After adding or deleting nodes, try undoing this (ctrl+z)<\/li> <li>Nodes now can be edited using rich text editing. You can play with the B-I-U buttons, or paste some text from another webpage.<\/li> <li>Try cutting (ctrl+x) and pasting (ctrl+v) nodes around. Copy is not implemented yet.<\/li> <li>I abandoned the idea of porting this to SVG, because current method works well enough.<\/li> <\/ul> <\/div>",Vub='<div><\/div>',cub="<img src='",wwb="<span class='GpzsesyD'> Mind Notes <span style='font-size: 21px'>(28.07.2010)<\/span> <\/span> <span id='",ovb='=',Nob='@',Vqb='A request timeout has expired after ',dqb='ABSOLUTE',aqb='AUTO',OAb='AbsolutePanel',Fzb='AbstractCollection',XCb='AbstractHashMap',YCb='AbstractHashMap$EntrySet',ZCb='AbstractHashMap$EntrySetIterator',_Cb='AbstractHashMap$MapEntryNull',aDb='AbstractHashMap$MapEntryString',EAb='AbstractImagePrototype',XAb='AbstractList',bDb='AbstractList$IteratorImpl',WCb='AbstractMap',cDb='AbstractMap$1',dDb='AbstractMap$1$1',eDb='AbstractMap$2',fDb='AbstractMap$2$1',$Cb='AbstractMapEntry',gDb='AbstractSequentialList',aAb='AbstractSerializationStream',bAb='AbstractSerializationStreamReader',cAb='AbstractSerializationStreamWriter',Gzb='AbstractSet',fEb='ActionButtons',gEb='ActionButtons$1',hEb='ActionButtons$2',iEb='ActionButtons$3',jEb='ActionButtons$4',kEb='ActionButtons$5',tDb='Act
